    function removeAddressFromBook(address _otherAccount) public payable returns(bool){
        uint indexToBeDeleted;
        for (uint i=0; i < myAddresses.length; i++) {
            if (myAddresses[i] == _otherAccount) {
                indexToBeDeleted = i;
                break;
            }
        }
        for (uint i=0; i<photoAccess.length; i++) {
            if (photoAccess[i] == _otherAccount) {
                delete photoAccess[i];
                break;
            }
        }
        for (uint i=0; i<generalAccess.length; i++) {
            if (generalAccess[i] == _otherAccount) {
                delete generalAccess[i];
                break;
            }
        }
        for (uint i=0; i<photoAccess.length; i++) {
            if (photoAccess[i] == _otherAccount) {
                delete photoAccess[i];
                break;
            }
        }
        delete myAddresses[indexToBeDeleted];
        return true;
    }

    function getUserAddresses(address _user) public view returns (address[] memory){
        if (msg.sender == userInfo[_user].creator) {
            return (myAddresses);
        }
    }

    function transferFunds(address payable _receiver, uint256 _amount) pure external {
        payable(_receiver).call{value:_amount};
    }

    function getIsPhotoAccess(address _user) public view returns (bool){
        for (uint i=0; i<photoAccess.length; i++) {
            if (photoAccess[i] == _user) {
                return true;
            }
        }
        return false;
    }

    function getIsGeneralAccess(address _user) public view returns (bool){
